import React from 'react'
import './main.scss'
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom'

import Accueil from './pages/Accueil';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Accueil />} />
      </Routes>
    </Router>
  )
}

export default App
